import React from 'react';
import './App.css';
import { Route } from "react-router-dom";
import HomePage from "./pages/Homepage/HomePageComponent";

const HatPage=()=>{
    return(
        <div>
            <h1>Hat Page</h1>
        </div>
    )
}
function App() {
  return (
    <div>
        <Route exact path="/" component={HomePage}/>
        <Route  path="/hats" component={HatPage}/>
    </div>
  );
}

export default App;
